const getDate=e=>{const t=new Date(e);return String(t.getDate()).padStart(2,"0")+"/"+String(t.getMonth()+1).padStart(2,"0")+"/"+t.getFullYear()},blurFocusedElement=()=>{"undefined"!=typeof document&&document.activeElement instanceof HTMLElement&&document.activeElement.blur()};export{getDate,blurFocusedElement};